import React from 'react';
import './App.css';
//import $ from 'jquery';

const App = () => {
  return (
    <article className="App">
      <Header>
      </Header>
    </article>
  );
}

function Header() {
  return (
      <header className="App-header">
        <p>HH</p>
        <h1>Huutoniemen Hoki</h1>
      </header>
  );
}

export default App;
